<!DOCTYPE html>
<html>

<head>
    <meta charset="UTF-8">
    <style type="text/css">

        body {
            font-family: Tahoma, Geneva, Verdana, sans-serif;
        }

        .page-header, .page-header-space {
            height: 100px;
        }

        .page-footer, .page-footer-space {
            height: 50px;
        }

        .page-footer {
            position: fixed;
            bottom: 0;
            width: 100%;
            border-top: 1px solid black;
            background: white;
            padding-top: 10px;
        }

        .page-header {
            position: fixed;
            top: 0mm;
            width: 100%;
            border-bottom: 1px solid black;
            background: white;
        }

        .page {
            page-break-after: always;
        }

        .logo-container {
            height: 90px;
            width: auto;
            padding-bottom: 10px;
        }

        .title {
            font-size: 18px;
            padding-top: 25px;
            padding-bottom: 20px;
            padding-left: 10px;
            text-align: center;
            font-weight: bold;
        }

        .sub-tilte {
            font-size: 18px;
            padding-top: 20px;
            padding-bottom: 20px;
            padding-left: 10px;
            text-align: left;
            font-weight: bold;
        }

        .chat {
            font-size: 18px;
            padding-left: 10px;
        }

        conversation-title {
            font-size: 18px;
            font-weight: bold;
            text-decoration: underline;
            text-transform: uppercase;
        }

        @page {
            margin: 20mm
        }

        @media print {
            thead {
                display: table-header-group;
            }

            tfoot {
                display: table-footer-group;
            }

            button {
                display: none;
            }

            body {
                margin: 0;
            }
        }
    </style>
</head>
